import React, { useState } from "react";

export const Login = () => {
  const [user, setUser] = useState({
    email: "",
    contraseña: "",
  });

  return (
    <div className="login-page">
      <form>
        <input
          type="email"
          name="email"
          required
          placeholder="Email"
          value="{user.email}"
        />

        <input
          type="contraseña"
          name="contraseña"
          required
          placeholder="Contraseña"
          value="{user.contraseña}"
        />
      </form>
    </div>
  );
};
